module.exports = {
    presets: [
      ['@babel/preset-env',
        {
          useBuiltIns: 'usage',
          modules: false,
          corejs: 3,
        },
      ],
    ],
    plugins: [
      '@babel/plugin-syntax-jsx',
      ['babel-plugin-module-resolver', {
        alias: {
          '@': './',
          '@babel/runtime': '@babel/runtime-corejs3',
        },
      }],
      '@babel/plugin-syntax-dynamic-import',
      ['@babel/plugin-proposal-decorators', {
        legacy: true,
      }],
      ['@babel/plugin-proposal-class-properties', {
        loose: true,
      }],
      ['@babel/plugin-transform-runtime', {
        useESModules: true,
        corejs: 3,
      }],
  
    ],
  };

import resolve from 'rollup-plugin-node-resolve';
import babel from 'rollup-plugin-babel';
import commonjs from 'rollup-plugin-commonjs';
import { terser } from 'rollup-plugin-terser';
import pkg from './package.json';

const external = [
  ...Object.keys(pkg.peerDependencies || {}),
  ...Object.keys(pkg.dependencies || {}),
];

export default {
  input: 'src/index.js',
  external,
  output: {
    file: 'dist/index.min.js',
    format: 'iife',
    name: 'pggLibs',
  },
  context: 'window', // 解决顶级的this的值为undefined的问题
  plugins: [
    resolve(), // 解决依赖路径
    commonjs(), // 将 CommonJS 模块转换为 ES2015 供 Rollup 处理
    babel({
      exclude: '**/node_modules/**',
      runtimeHelpers: true,
    }),
    terser({ // 压缩代码
      compress: {
        pure_getters: true,
        unsafe: true,
        unsafe_comps: true,
        warnings: false,
      },
    }),
  ],
};

import { test } from "../util/index"

export default{
    test
}

/**
 * 测试函数
 * @description rb_base_libs测试函数
 * @param {array} array 数组
 * @param {number} [size=1] 每个块的长度
 * @returns {array} 返回的新数组
 */
 export default function (array, size) {
    const list = [].concat(array);
    const len = list.length;
    const _arr = [];
  
    let i = 0;
    while (i < len) {
      const _chunk = array.splice(0, size);
      _arr.push(_chunk);
      i += size;
    }
  
    return _arr;
  }
